import React, { Component,  } from "react";
class button extends Component {
  constructor() {
    super();
    this.state = { number: 0 };
    this.clickEvent = this.clickEvent.bind(this);
  }
  clickEvent() {
    this.setState((previousNumber) => {
      return { number: previousNumber + 1 };
    });
  }
  render() {
    return (
      <button type="button" class="btn btn-info" onClick={this.clickEvent}>
        this.state.nu
      </button>
    );
  }
}
export default button;
